  // Fetched items
  const items = async () => {
    const res = await fetch(`https://fakestoreapi.com/products/`)
    const data = await res.json()

    setProducts(data)
  } 

  return (
    <div className="">
      <div className=''>
        {products.id}<p></p>
        {products.title}
        {products.description}
        <img src={`${products.image}`} alt="" />
      </div>
    </div>
  )
}

